INSERT INTO `searchindex` VALUES (1,'main page',' __notitle__ what isu800 openrov what isu800 openrov what isu800 openrov style background-color #ffffff; width 95u800 - style width 50u800 ; background-color white; openrov isu800 au8e280a8 dou800 itu800 yourself telerobotics community centered around underwater exploration andu800 education. weu800 have developed au800 lowu800-cost telerobotic submarine that canu800 beu800 built with mostly offu800-theu800-shelf partsu82eu8e280a8the goal ofu800 openrov isu800 tou800 democratize exploration byu800 allowing anyone tou800 explore andu800 study underwater environments. theu800 u8e280a8 openrov community isu800 also laying theu800 foundation foru800 globally-connected citizen scientists tou800 share their data andu800 findingsu82eu8e280a8 questions oru800 suggestions feel free tou800 email usu800 atu800 info openrovu82ecomu800 . style width 50u800 ; -- this version ofu800 theu800 embed code isu800 nou800 longer supported. learn more -- openrov meets theu800 openwater from gerty onu800 vimeo . where canu800 iu800 getu800 help where canu800 iu800 getu800 help where canu800 iu800 getu800 help ifu800 youu800 need help following instructions oru800 ifu800 youu800\'reu800 stuck atu800 some step andu800 something hasu800 gone wrong there areu800 several ways tou800 getu800 help from theu800 openrov users andu800 developer community. first carefully reu800-read andu800 review allu800 applicable instructions andu800 make sure youu800 didn\'tu800 dou800 something wrong oru800 outu800 ofu800 sequence. many ofu800 these instructions involve long commands andu800 just oneu800 wrong character will mess theu800 whole thing upu800. additionally youu800 canu800 also check theu800 troubleshooting page foru800 additional information. ifu800 youu800 continue tou800 have issues asku800 theu800 community foru800 help. your resources foru800 help include openrov wiki u8e28094 foru800 searching & contributing documentation; registration isu800 required tou800 contribute. openrov ircu800 channel onu800 freenode u8e28094 foru800 immediate chat oneu800-onu800-oneu800 assistance; registration isu800 required seeu800 nick setup oru800 youu800 will notu800 beu800 able tou800 enter . openrov forum u8e28094 au800 forum dedicated tou800 openrov andu800 other related stuff; registration isu800 required tou800 post. although most community members areu800 happy tou800 provide advice andu800 help please remember most people volunteer their personal time andu800 effort inu800 doing sou800. observing patience andu800 courtesy goes au800 long wayu800. documentation guides documentation guides documentation guides file gaugeu82epngu800 getting started - file crateu82epngu800 downloads - file booku82epngu800 assembly - file videosu82ejpeg deployment - file questionu82epngu800 troubleshooting '),(9,'booku82epngu800',' '),(10,'videosu82ejpeg',' '),(11,'getting started',' ifu800 youu800 want tou800 learn about theu800 software please visit theu800 softwarearchitecture software architecture page. '),(12,'downloads',' weu800 useu800 github tou800 host ouru800 code. please visit theu800 github profile atu800 weu800\'veu800 broken itu800 upu800 into 3u800 categories hardware software electronics theu800 hardware section contains theu800 cadu800 files foru800 cutting theu800 rovu800. theu800 software section contains theu800 software foru800 running theu800 rovu800 theu800 software that runs onu800 theu800 onu800-board computer andu800 arduino . theu800 electronics section contains theu800 schematic files foru800 theu800 beaglebone cape. each section will probably beu800 expanded butu800 weu800 mayu800 combine some parts ifu800 itu800 makes sense. '),(13,'assembly',' # building from scratch # prepairing foru800 assembly parts check tools needed ... # assembly ofu800 main structure # assembly ofu800 endu800 caps # assembly ofu800 electronics chassis # assembly ofu800 battery packs '),(14,'deployment',' this isu800 au800 placeholder