INSERT INTO `text` VALUES (1,'\'\'\'MediaWiki has been successfully installed.\'\'\'\n\nConsult the [//meta.wikimedia.org/wiki/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [//www.mediawiki.org/wiki/Manual:Configuration_settings Configuration settings list]\n* [//www.mediawiki.org/wiki/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]','utf-8'),(2,'==About==\nOpenROV is a  Do It Yourself telerobotics community centered around underwater exploration and education. We have developed a low-cost telerobotic submarine that can be built with mostly off-the-shelf parts. The goal of OpenROV is to democratize exploration by allowing anyone to explore and study underwater environments. The  [http://openrov.com/forum OpenROV community] is also laying the foundation for globally-connected citizen scientists to share their data and findings.  Questions or suggestions? Feel free to email us at [mailto:Info@OpenROV.com Info@OpenROV.com].\n\n==Specifications==* \'\'\'Version:\'\'\' 2.3* \'\'\'Dimensions:\'\'\' 30cm x 20cm x 15cm* \'\'\'Weight:\'\'\' 2.5kg* \'\'\'Depth rating:\'\'\' ~100m* \'\'\'Speed:\'\'\' 1m/sec* \'\'\'Power:\'\'\' 8 onboard C batteries* \'\'\'Run time:\'\'\' ~1.5 hours\n\n==Design== * \'\'\'Version:\'\'\' 2.3* \'\'\'Body construction:\'\'\' Laser cut acrylic* \'\'\'Buoyancy:\'\'\' Inherently neutrally buoyant* \'\'\'Propulsion:\'\'\' 3 brushless motors (2 horizontal thrusters, 1 vertical thruster)* \'\'\'Tether:\'\'\' 1 single twisted pair communicating 10 megabit ethernet data for control and video* \'\'\'Control:\'\'\' Onboard embedded linux computer (beagleboard brand) controlled via remote web browser* \'\'\'Vision:\'\'\' Forward facing HD USB webcam and two 87lm LED light arrays on servo-tiltable platform* \'\'\'Design considerations:\'\'\' Completely open source / open hardware, off the shelf parts, small enough to test in a bathtub, kit can be assembled in one weekend, standardized payload bay.','utf-8'),(3,'==About==\nOpenROV is a  Do It Yourself telerobotics community centered around underwater exploration and education. We have developed a low-cost telerobotic submarine that can be built with mostly off-the-shelf parts. The goal of OpenROV is to democratize exploration by allowing anyone to explore and study underwater environments. The  [http://openrov.com/forum OpenROV community] is also laying the foundation for globally-connected citizen scientists to share their data and findings.  Questions or suggestions? Feel free to email us at [mailto:Info@OpenROV.com Info@OpenROV.com].\n\n==Specifications==\n* \'\'\'Version:\'\'\' 2.3\n* \'\'\'Dimensions:\'\'\' 30cm x 20cm x 15cm\n* \'\'\'Weight:\'\'\' 2.5kg\n* \'\'\'Depth rating:\'\'\' ~100m\n* \'\'\'Speed:\'\'\' 1m/sec\n* \'\'\'Power:\'\'\' 8 onboard C batteries\n* \'\'\'Run time:\'\'\' ~1.5 hours\n\n==Design== * \'\'\'Version:\'\'\' 2.3* \'\'\'Body construction:\'\'\' Laser cut acrylic* \'\'\'Buoyancy:\'\'\' Inherently neutrally buoyant* \'\'\'Propulsion:\'\'\' 3 brushless motors (2 horizontal thrusters, 1 vertical thruster)* \'\'\'Tether:\'\'\' 1 single twisted pair communicating 10 megabit ethernet data for control and video* \'\'\'Control:\'\'\' Onboard embedded linux computer (beagleboard brand) controlled via remote web browser* \'\'\'Vision:\'\'\' Forward facing HD USB webcam and two 87lm LED light arrays on servo-tiltable platform* \'\'\'Design considerations:\'\'\' Completely open source / open hardware, off the shelf parts, small enough to test in a bathtub, kit can be assembled in one weekend, standardized payload bay.','utf-8'),(4,'==About==\nOpenROV is a  Do It Yourself telerobotics community centered around underwater exploration and education. We have developed a low-cost telerobotic submarine that can be built with mostly off-the-shelf parts. The goal of OpenROV is to democratize exploration by allowing anyone to explore and study underwater environments. The  [http://openrov.com/forum OpenROV community] is also laying the foundation for globally-connected citizen scientists to share their data and findings.  Questions or suggestions? Feel free to email us at [mailto:Info@OpenROV.com Info@OpenROV.com].\n\n==Specifications==\n* \'\'\'Version:\'\'\' 2.3\n* \'\'\'Dimensions:\'\'\' 30cm x 20cm x 15cm\n* \'\'\'Weight:\'\'\' 2.5kg\n* \'\'\'Depth rating:\'\'\' ~100m\n* \'\'\'Speed:\'\'\' 1m/sec\n* \'\'\'Power:\'\'\' 8 onboard C batteries\n* \'\'\'Run time:\'\'\' ~1.5 hours\n\n==Design== \n* \'\'\'Version:\'\'\' 2.3\n* \'\'\'Body construction:\'\'\' Laser cut acrylic\n* \'\'\'Buoyancy:\'\'\' Inherently neutrally buoyant\n* \'\'\'Propulsion:\'\'\' 3 brushless motors (2 horizontal thrusters, 1 vertical thruster)\n* \'\'\'Tether:\'\'\' 1 single twisted pair communicating 10 megabit ethernet data for control and video\n* \'\'\'Control:\'\'\' Onboard embedded linux computer (beagleboard brand) controlled via remote web browser\n* \'\'\'Vision:\'\'\' Forward facing HD USB webcam and two 87lm LED light arrays on servo-tiltable platform\n* \'\'\'Design considerations:\'\'\' Completely open source / open hardware, off the shelf parts, small enough to test in a bathtub, kit can be assembled in one weekend, standardized payload bay.','utf-8'),(5,'From {{SITENAME}} goooooooooood morning','utf-8'),(6,'\nMozilla Cavendish Theme based on Cavendish style by Gabriel Wicke modified by [http://www.dasch-tour.de DaSch] for the [http://www.wecowi.de/ Web Community Wiki]\n\n[http://sourceforge.net/projects/wecowi/ Sourceforge Projectpage] [https://sourceforge.net/tracker/?group_id=256816&atid=3135768 Report Bug] Skin-Version: 1.5.0','utf-8'),(7,'\n==Software==\nMozilla Cavendish Theme based on Cavendish style by Gabriel Wicke modified by [http://www.dasch-tour.de DaSch] for the [http://www.wecowi.de/ Web Community Wiki]\n\n[http://sourceforge.net/projects/wecowi/ Sourceforge Projectpage] [https://sourceforge.net/tracker/?group_id=256816&atid=3135768 Report Bug] Skin-Version: 1.5.0','utf-8'),(8,'\n\n==About==\nOpenROV is a  Do It Yourself telerobotics community centered around underwater exploration and education. We have developed a low-cost telerobotic submarine that can be built with mostly off-the-shelf parts. \n\nThe goal of OpenROV is to democratize exploration by allowing anyone to explore and study underwater environments. \n\nThe  [http://openrov.com/forum OpenROV community] is also laying the foundation for globally-connected citizen scientists to share their data and findings.  Questions or suggestions? Feel free to email us at [mailto:Info@OpenROV.com Info@OpenROV.com].\n\n==Specifications==\n* \'\'\'Version:\'\'\' 2.3\n* \'\'\'Dimensions:\'\'\' 30cm x 20cm x 15cm\n* \'\'\'Weight:\'\'\' 2.5kg\n* \'\'\'Depth rating:\'\'\' ~100m\n* \'\'\'Speed:\'\'\' 1m/sec\n* \'\'\'Power:\'\'\' 8 onboard C batteries\n* \'\'\'Run time:\'\'\' ~1.5 hours\n\n==Design== \n* \'\'\'Version:\'\'\' 2.3\n* \'\'\'Body construction:\'\'\' Laser cut acrylic\n* \'\'\'Buoyancy:\'\'\' Inherently neutrally buoyant\n* \'\'\'Propulsion:\'\'\' 3 brushless motors (2 horizontal thrusters, 1 vertical thruster)\n* \'\'\'Tether:\'\'\' 1 single twisted pair communicating 10 megabit ethernet data for control and video\n* \'\'\'Control:\'\'\' Onboard embedded linux computer (beagleboard brand) controlled via remote web browser\n* \'\'\'Vision:\'\'\' Forward facing HD USB webcam and two 87lm LED light arrays on servo-tiltable platform\n* \'\'\'Design considerations:\'\'\' Completely open source / open hardware, off the shelf parts, small enough to test in a bathtub, kit can be assembled in one weekend, standardized payload bay.','utf-8'),(9,'','utf-8'),(10,'\n\n==About==\nOpenROV is a  Do It Yourself telerobotics community centered around underwater exploration and education. We have developed a low-cost telerobotic submarine that can be built with mostly off-the-shelf parts. \n\nThe goal of OpenROV is to democratize exploration by allowing anyone to explore and study underwater environments. \n\nThe  [http://openrov.com/forum OpenROV community] is also laying the foundation for globally-connected citizen scientists to share their data and findings.  Questions or suggestions? Feel free to email us at [mailto:Info@OpenROV.com Info@OpenROV.com].\n\n==Specifications==\n* \'\'\'Version:\'\'\' 2.3\n* \'\'\'Dimensions:\'\'\' 30cm x 20cm x 15cm\n* \'\'\'Weight:\'\'\' 2.5kg\n* \'\'\'Depth rating:\'\'\' ~100m\n* \'\'\'Speed:\'\'\' 1m/sec\n* \'\'\'Power:\'\'\' 8 onboard C batteries\n* \'\'\'Run time:\'\'\' ~1.5 hours\n\n==Design== \n* \'\'\'Version:\'\'\' 2.3\n* \'\'\'Body construction:\'\'\' Laser cut acrylic\n* \'\'\'Buoyancy:\'\'\' Inherently neutrally buoyant\n* \'\'\'Propulsion:\'\'\' 3 brushless motors (2 horizontal thrusters, 1 vertical thruster)\n* \'\'\'Tether:\'\'\' 1 single twisted pair communicating 10 megabit ethernet data for control and video\n* \'\'\'Control:\'\'\' Onboard embedded linux computer (beagleboard brand) controlled via remote web browser\n* \'\'\'Vision:\'\'\' Forward facing HD USB webcam and two 87lm LED light arrays on servo-tiltable platform\n* \'\'\'Design considerations:\'\'\' Completely open source / open hardware, off the shelf parts, small enough to test in a bathtub, kit can be assembled in one weekend, standardized payload bay.\n\n[[File:rov.jpeg]]','utf-8'),(11,'==About==\nOpenROV is a  Do It Yourself telerobotics community centered around underwater exploration and education. We have developed a low-cost telerobotic submarine that can be built with mostly off-the-shelf parts. \n\nThe goal of OpenROV is to democratize exploration by allowing anyone to explore and study underwater environments. \n\nThe  [http://openrov.com/forum OpenROV community] is also laying the foundation for globally-connected citizen scientists to share their data and findings.  Questions or suggestions? Feel free to email us at [mailto:Info@OpenROV.com Info@OpenROV.com].\n\n==Specifications==\n* \'\'\'Version:\'\'\' 2.3\n* \'\'\'Dimensions:\'\'\' 30cm x 20cm x 15cm\n* \'\'\'Weight:\'\'\' 2.5kg\n* \'\'\'Depth rating:\'\'\' ~100m\n* \'\'\'Speed:\'\'\' 1m/sec\n* \'\'\'Power:\'\'\' 8 onboard C batteries\n* \'\'\'Run time:\'\'\' ~1.5 hours\n\n==Design== \n* \'\'\'Version:\'\'\' 2.3\n* \'\'\'Body construction:\'\'\' Laser cut acrylic\n* \'\'\'Buoyancy:\'\'\' Inherently neutrally buoyant\n* \'\'\'Propulsion:\'\'\' 3 brushless motors (2 horizontal thrusters, 1 vertical thruster)\n* \'\'\'Tether:\'\'\' 1 single twisted pair communicating 10 megabit ethernet data for control and video\n* \'\'\'Control:\'\'\' Onboard embedded linux computer (beagleboard brand) controlled via remote web browser\n* \'\'\'Vision:\'\'\' Forward facing HD USB webcam and two 87lm LED light arrays on servo-tiltable platform\n* \'\'\'Design considerations:\'\'\' Completely open source / open hardware, off the shelf parts, small enough to test in a bathtub, kit can be assembled in one weekend, standardized payload bay.\n\n[[File:rov.jpeg]]','utf-8'),(12,'==About==\nOpenROV is a  Do It Yourself telerobotics community centered around underwater exploration and education. We have developed a low-cost telerobotic submarine that can be built with mostly off-the-shelf parts. \n\nThe goal of OpenROV is to democratize exploration by allowing anyone to explore and study underwater environments. \n\nThe  [http://openrov.com/forum OpenROV community] is also laying the foundation for globally-connected citizen scientists to share their data and findings.  Questions or suggestions? Feel free to email us at [mailto:Info@OpenROV.com Info@OpenROV.com].\n\n==Specifications==\n* \'\'\'Version:\'\'\' 2.3\n* \'\'\'Dimensions:\'\'\' 30cm x 20cm x 15cm\n* \'\'\'Weight:\'\'\' 2.5kg\n* \'\'\'Depth rating:\'\'\' ~100m\n* \'\'\'Speed:\'\'\' 1m/sec\n* \'\'\'Power:\'\'\' 8 onboard C batteries\n* \'\'\'Run time:\'\'\' ~1.5 hours\n\n==Design== \n* \'\'\'Version:\'\'\' 2.3\n* \'\'\'Body construction:\'\'\' Laser cut acrylic\n* \'\'\'Buoyancy:\'\'\' Inherently neutrally buoyant\n* \'\'\'Propulsion:\'\'\' 3 brushless motors (2 horizontal thrusters, 1 vertical thruster)\n* \'\'\'Tether:\'\'\' 1 single twisted pair communicating 10 megabit ethernet data for control and video\n* \'\'\'Control:\'\'\' Onboard embedded linux computer (beagleboard brand) controlled via remote web browser\n* \'\'\'Vision:\'\'\' Forward facing HD USB webcam and two 87lm LED light arrays on servo-tiltable platform\n* \'\'\'Design considerations:\'\'\' Completely open source / open hardware, off the shelf parts, small enough to test in a bathtub, kit can be assembled in one weekend, standardized payload bay.\n\n[[File:rov.jpeg]]','utf-8'),(13,'','utf-8'),(14,'[[File:gauge.png]] Quick Start','utf-8'),(15,'','utf-8'),(16,'','utf-8'),(17,'','utf-8'),(18,'','utf-8'),(19,'[[File:gauge.png]] Quick Start\n\n[[File:crate.png]]\n\n[[File:videos.jpeg]]\n\n[[File:book.png]]\n\n[[File:question.png]]','utf-8'),(20,'Getting Started\n\nDownloads\n\nAssembly\n\nDeployment\n\nTroubleshooting','utf-8'),(21,'==Getting Started==','utf-8'),(22,'This is a placeholder','utf-8'),(23,'[[Getting Started]]\n\nDownloads\n\nAssembly\n\nDeployment\n\nTroubleshooting','utf-8'),(24,'\n\n[[Category:Bulletins]]<teaser>Interested in this article?</teaser>Main article text to be displayed on the page.\n\nThis is a placeholder','utf-8'),(25,'This is a placeholder','utf-8'),(26,'<dynbox title=\"My Title\" posx=XXpx posy=XXpx iconcolor=\"color\" iconbgcolor=\"color\" boxcolor=\"color\" \n boxbgcolor=\"color\" color=\"color\" bgcolor=\"#f1f1f1\"> This is some random test for the note box </dynbox>\nThis is a placeholder','utf-8'),(27,'\n\nThis is a placeholder','utf-8'),(28,'\nThis is a placeholder','utf-8'),(29,'[[Getting Started]]\n\n[[Downloads]]\n\n[[Assembly]]\n\n[[Deployment]]\n\n[[Troubleshooting]]','utf-8'),(30,'This is a placeholder','utf-8'),(31,'This is a placeholder','utf-8'),(32,'This is a placeholder','utf-8'),(33,'This is a placeholder','utf-8'),(34,'This is a placeholder\n\n\n[[OBCROV-1]]\n\n[[TSCROV-1]]','utf-8'),(35,'<pre>\n//OBCROV-1 (On-Board Controller for ROV-1)\n//Created by Eric Stackpole for OpenROV\n//This code allows an Arduino microcontroller to command three motors, a light, and a servo based on serial input sent though it\'s USB plug from an external source\n//This program works with \"TSCROV-1 (Top-Side Controller for ROV-1)\" which can be found on OpenROV.com\n//To see a video of the code working, watch the YouTube Video at http://www.youtube.com/watch?v=8r7Kt1p31vs\n\n//OBCROV-1 by Eric Stackpole is licensed under a Creative Commons Attribution-NonCommercial-ShareAlike 3.0 Unported License.\n//For more informatino, please visit OpenROV.com\n\n#include <Servo.h>  //Allow the Arduino to understand code for controlling a servo\n\n// Arduino pins that each variable will control\n// Upper Case for Direction, Lower Case for PWM\nconst int V = 8;   //Vertical direction\nconst int P = 12;  //Port (left) direction\nconst int S = 13;  //Starbord (right) direction\nconst int v = 3;   //Vertical PWM (speed)\nconst int p = 5;   //Port (left) PWM (speed)\nconst int s = 6;   //Starbord (right) PWM (speed)\nconst byte l = 11; //Light PWM (intensity)\n\n// Set inital angle of servo (intended to control tilt angle of a camera)\nServo tilt;\nint pos = 80;\n\nvoid setup(){\n \n  // initialize the serial communication:\n  Serial.begin(9600);\n\n  // initialize the pins as an outputs:\n  pinMode(V, OUTPUT);\n  pinMode(P, OUTPUT);\n  pinMode(S, OUTPUT);\n  pinMode(v, OUTPUT);\n  pinMode(p, OUTPUT);\n  pinMode(s, OUTPUT);\n  pinMode(l, OUTPUT);\n \n  // attach the servo on pin 14 (analog 0) to the servo object, \"tilt\"\n  tilt.attach(14);\n}\n\n  byte input;\n  byte x = 250;\n  byte i = 128;\n\nvoid loop(){\n  if (Serial.available()){\n    input = Serial.read();\n\n//Turn motors on/off at speed \"x\" (lower case) and direction (upper case) based on input of F (Forward), A (Aft), P (Port), S (Starbord), V (Vertical)\n      switch (input){\n        case \'F\':\n          digitalWrite(P, HIGH);\n          digitalWrite(S, HIGH);\n          analogWrite(p, x);\n          analogWrite(s, x);\n          break;\n        case \'A\':\n          digitalWrite(P, LOW);\n          digitalWrite(S, LOW);\n          analogWrite(p, x);\n          analogWrite(s, x);         \n          break;\n        case \'P\':\n          digitalWrite(P, LOW);\n          digitalWrite(S, HIGH);\n          analogWrite(p, x);\n          analogWrite(s, x);\n          break;\n        case \'S\':\n          digitalWrite(P, HIGH);\n          digitalWrite(S, LOW);\n          analogWrite(p, x);\n          analogWrite(s, x);\n          break;\n        case \'U\':\n          digitalWrite(V, HIGH);\n          analogWrite(v, x);\n          break;\n        case \'D\':\n          digitalWrite(V, LOW);\n          analogWrite(v, x);\n          break;\n        case \'h\':\n          i++;\n          analogWrite(l, i);\n          break;\n        case \'l\':\n          i--;\n          analogWrite(l, i);\n          break;\n        case \'1\':\n          x = 50;\n          break;\n        case \'2\':\n          x = 150;\n          break;\n        case \'3\':\n          x = 250;\n          break;\n        case \'q\':\n          pos = 30;\n          break;\n        case \'a\':\n          pos = 80;\n          break;\n        case \'z\':\n          pos = 150;\n          break;\n        default:\n          analogWrite(s, 0);\n          analogWrite(v, 0);\n          analogWrite(p, 0);\n          //pos = 80;\n       }\n\n    // set servo position according to value of pos\n    tilt.write(pos);\n    }\n}\n</pre>','utf-8'),(36,'<pre>\n//TSCROV-1 (Top-Side Controller for ROV-1)\n//Created by Eric Stackpole for OpenROV\n//This code allows a computer to output serial commands to control three motors, a light, and a servo based on keyboard input from the user\n//This program works with \"OBCROV-1 (On-Board Controller for ROV-1)\" which can be found on OpenROV.com\n//To see a video of the code working, watch the YouTube Video at http://www.youtube.com/watch?v=8r7Kt1p31vs\n\n//TSCROV-1 by Eric Stackpole is licensed under a Creative Commons Attribution-NonCommercial-ShareAlike 3.0 Unported License.\n//For more informatino, please visit OpenROV.com\n\nimport processing.serial.*;\nSerial port;\n\nvoid setup(){\n  println(Serial.list());\n  port = new Serial(this, Serial.list()[0], 9600);\n}\n   \n\n//Keyboard commands are intended to control the ROV as follows: \"q\", \"a\", and \"z\" control the servo (camera tilt) position; \"h\" and \"l\" (high and low) control light intensity; and \"1\", \"2\", and \"3\" control thruster speed level\n\nvoid draw() {\n  if (keyPressed){\n    switch (key){\n      case \'q\': port.write(\'q\');break; //Look up\n      case \'a\': port.write(\'a\');break; //Look stright\n      case \'z\': port.write(\'z\');break; //Look down\n      case \'h\': port.write(\'h\');break; //Increase light intensity\n      case \'l\': port.write(\'l\');break; //Decrease light intensity\n      case \'1\': port.write(\'1\');break; //Low motor speed\n      case \'2\': port.write(\'2\');break; //Medium motor speed\n      case \'3\': port.write(\'3\');break; //High motor speed\n    }\n   \n    // Arrow keys control forward/ backward and rotation movement of ROV intuitivly, shift and control control vertical motion\n    if (key == CODED){\n      switch (keyCode){\n        case UP: port.write(\'F\');break;      //Move forward\n        case DOWN: port.write(\'A\');break;    //Move aft\n        case LEFT: port.write(\'P\');break;    //Rotate to port (left)\n        case RIGHT: port.write(\'S\');break;   //Rotate to starbord (right)\n        case SHIFT: port.write(\'U\');break;   //Move up\n        case CONTROL: port.write(\'D\');break; //Move down\n        default: port.write(\'0\');break;      //Default to \"0\" which does nothing do decrese likelyhood of unintended commands\n      }\n    }\n  }\n   else port.write(\'0\');\n}\n</pre>','utf-8'),(37,'We are moving our code to Github at: https://github.com/OpenROV\n\nHere is the software used to operate ROV-1\n \nThere are two separate programs: OBCROV-1 (On Board Controller for ROV-1) which runs on the [http://www.arduino.cc/ Arduino] on board the ROV, and TSCROV-1 (Top Side Controller for ROV-1) which runs through [http://processing.org/ Processing] on a computer used to control the ROV.\n \nYou can find the source code for both programs here  (you can copy/past the entire content of each page into the appropriate compiler (Arduino for OBCROV-1 and Processing for TSCROV-1):\n\n[[OBCROV-1]]\n\n[[TSCROV-1]]','utf-8'),(38,'We are moving our code to Github at: https://github.com/OpenROV\n\nHere is the software used to operate ROV-1\n \nThere are two separate programs: OBCROV-1 (On Board Controller for ROV-1) which runs on the [http://www.arduino.cc/ Arduino] on board the ROV, and TSCROV-1 (Top Side Controller for ROV-1) which runs through [http://processing.org/ Processing] on a computer used to control the ROV.\n \nYou can find the source code for both programs here  (you can copy/past the entire content of each page into the appropriate compiler (Arduino for OBCROV-1 and Processing for TSCROV-1):\n\n[[OBCROV-1]]\n\n[[TSCROV-1]]\n\n<code download>\n//OBCROV-1 (On-Board Controller for ROV-1)\n//Created by Eric Stackpole for OpenROV\n//This code allows an Arduino microcontroller to command three motors, a light, and a servo based on serial input sent though it\'s USB plug from an external source\n//This program works with \"TSCROV-1 (Top-Side Controller for ROV-1)\" which can be found on OpenROV.com\n//To see a video of the code working, watch the YouTube Video at http://www.youtube.com/watch?v=8r7Kt1p31vs\n\n//OBCROV-1 by Eric Stackpole is licensed under a Creative Commons Attribution-NonCommercial-ShareAlike 3.0 Unported License.\n//For more informatino, please visit OpenROV.com\n\n#include <Servo.h>  //Allow the Arduino to understand code for controlling a servo\n\n// Arduino pins that each variable will control\n// Upper Case for Direction, Lower Case for PWM\nconst int V = 8;   //Vertical direction\nconst int P = 12;  //Port (left) direction\nconst int S = 13;  //Starbord (right) direction\nconst int v = 3;   //Vertical PWM (speed)\nconst int p = 5;   //Port (left) PWM (speed)\nconst int s = 6;   //Starbord (right) PWM (speed)\nconst byte l = 11; //Light PWM (intensity)\n\n// Set inital angle of servo (intended to control tilt angle of a camera)\nServo tilt;\nint pos = 80;\n\nvoid setup(){\n \n  // initialize the serial communication:\n  Serial.begin(9600);\n\n  // initialize the pins as an outputs:\n  pinMode(V, OUTPUT);\n  pinMode(P, OUTPUT);\n  pinMode(S, OUTPUT);\n  pinMode(v, OUTPUT);\n  pinMode(p, OUTPUT);\n  pinMode(s, OUTPUT);\n  pinMode(l, OUTPUT);\n \n  // attach the servo on pin 14 (analog 0) to the servo object, \"tilt\"\n  tilt.attach(14);\n}\n\n  byte input;\n  byte x = 250;\n  byte i = 128;\n\nvoid loop(){\n  if (Serial.available()){\n    input = Serial.read();\n\n//Turn motors on/off at speed \"x\" (lower case) and direction (upper case) based on input of F (Forward), A (Aft), P (Port), S (Starbord), V (Vertical)\n      switch (input){\n        case \'F\':\n          digitalWrite(P, HIGH);\n          digitalWrite(S, HIGH);\n          analogWrite(p, x);\n          analogWrite(s, x);\n          break;\n        case \'A\':\n          digitalWrite(P, LOW);\n          digitalWrite(S, LOW);\n          analogWrite(p, x);\n          analogWrite(s, x);         \n          break;\n        case \'P\':\n          digitalWrite(P, LOW);\n          digitalWrite(S, HIGH);\n          analogWrite(p, x);\n          analogWrite(s, x);\n          break;\n        case \'S\':\n          digitalWrite(P, HIGH);\n          digitalWrite(S, LOW);\n          analogWrite(p, x);\n          analogWrite(s, x);\n          break;\n        case \'U\':\n          digitalWrite(V, HIGH);\n          analogWrite(v, x);\n          break;\n        case \'D\':\n          digitalWrite(V, LOW);\n          analogWrite(v, x);\n          break;\n        case \'h\':\n          i++;\n          analogWrite(l, i);\n          break;\n        case \'l\':\n          i--;\n          analogWrite(l, i);\n          break;\n        case \'1\':\n          x = 50;\n          break;\n        case \'2\':\n          x = 150;\n          break;\n        case \'3\':\n          x = 250;\n          break;\n        case \'q\':\n          pos = 30;\n          break;\n        case \'a\':\n          pos = 80;\n          break;\n        case \'z\':\n          pos = 150;\n          break;\n        default:\n          analogWrite(s, 0);\n          analogWrite(v, 0);\n          analogWrite(p, 0);\n          //pos = 80;\n       }\n\n    // set servo position according to value of pos\n    tilt.write(pos);\n    }\n}\n</code>','utf-8'),(39,'We are moving our code to Github at: https://github.com/OpenROV\n\nHere is the software used to operate ROV-1\n \nThere are two separate programs: OBCROV-1 (On Board Controller for ROV-1) which runs on the [http://www.arduino.cc/ Arduino] on board the ROV, and TSCROV-1 (Top Side Controller for ROV-1) which runs through [http://processing.org/ Processing] on a computer used to control the ROV.\n \nYou can find the source code for both programs here  (you can copy/past the entire content of each page into the appropriate compiler (Arduino for OBCROV-1 and Processing for TSCROV-1):\n\n[[OBCROV-1]]\n\n[[TSCROV-1]]','utf-8'),(40,'<code lang=\'c\'>\n//OBCROV-1 (On-Board Controller for ROV-1)\n//Created by Eric Stackpole for OpenROV\n//This code allows an Arduino microcontroller to command three motors, a light, and a servo based on serial input sent though it\'s USB plug from an external source\n//This program works with \"TSCROV-1 (Top-Side Controller for ROV-1)\" which can be found on OpenROV.com\n//To see a video of the code working, 