mands, and just one wrong character will mess the whole thing up. Additionally, You can also check the Troubleshooting page for additional information.\n\nIf you continue to have issues, ask the community for help. Your resources for help include:\n\n* [http://wiki.openrov.com OpenROV Wiki] — for searching & contributing documentation; registration is required to contribute.\n* [http://webchat.freenode.net/?channels=openrov OpenROV IRC channel] on Freenode — for immediate chat, one-on-one assistance; registration is required (see Nick Setup or you will not be able to enter).\n* [http://openrov.com/forum OpenROV Forum] — a forum dedicated to OpenROV and other related stuff; registration is required to post.\n\nAlthough most community members are happy to provide advice and help, please remember most people volunteer their personal time and effort in doing so. Observing patience and courtesy goes a long way.\n\n==Documentation Guides==\n{| \n| [[File:Gauge.png]] || [[Getting Started]]\n|-\n| [[File:Crate.png]] || [[Downloads]]\n|-\n| [[File:Book.png]] || [[Assembly]]\n|-\n| [[File:Videos.jpeg]] || [[Deployment]]\n|-\n| [[File:Question.png]] || [[Troubleshooting]]\n|}','utf-8'),(83,'Disclaimer','utf-8'),(84,'ALL CONTENT AND MATERIALS ON THIS SITE ARE PROVIDED \"AS IS\". OpenROV AND ITS RESPECTIVE SUPPLIERS MAKE NO REPRESENTATIONS ABOUT THE SUITABILITY OF THESE MATERIALS FOR ANY PURPOSE AND DISCLAIM ALL WARRANTIES AND CONDITIONS WITH REGARD TO THESE MATERIALS, INCLUDING BUT NOT LIMITED TO, ALL IMPLIED WARRANTIES AND CONDITIONS OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE, TITLE AND NON-INFRINGEMENT OF ANY THIRD PARTY INTELLECTUAL PROPERTY RIGHT. NO LICENSE, EITHER EXPRESS OR IMPLIED, BY ESTOPPEL OR OTHERWISE, IS GRANTED BY OpenROV. \n\nContent on this site may contain or be subject to specific guidelines or limitations on use. All postings and use of the content on this site are subject to the Terms of Use of the site; third parties using this content agree to abide by any limitations or guidelines and to comply with the Terms of Use of this site. OpenROV and its suppliers reserve the right to make corrections, deletions, modifications, enhancements, improvements and other changes to the content and materials, its products, programs and services at any time or to move or discontinue any content, products, programs, or services without notice.','utf-8'),(85,'Placeholder','utf-8'),(86,'The OpenROV team cares about your right to privacy. This policy explains how we intend to handle any personally identifying information you give us online. It does not apply to personally identifying information that we may collect offline. Personally identifying information is information that enables us to identify you, for example, your e-mail address, name, home phone number, etc.\n\n===== How We Collect and Use Personal Information=====\nYou are welcome to visit the OpenROV web sites while remaining anonymous and not revealing any personally identifying information. Sharing your personally identifying information is strictly voluntary. However, if you choose not to provide certain information, you may not be able to take advantage of many of OpenROV\'s features and programs. The information you provide to OpenROV will better enable OpenROV to communicate with you regarding our project.\n\n=====Cookies=====\nCookies are small text files that our web sites ask to place on your computer\'s hard drive. If your browser is set to accept cookies, then your browser adds the text in a small file. We do not use cookies to read any other information on your computer\'s hard drive. We use cookie technology to authenticate your access to various areas of our web site, tailor its content to your preferences, and to help us analyze web traffic in general. Most browsers are initially set to accept cookies. If you prefer, you can set yours to refuse cookies, or to warn you before a cookie is placed. If you choose not to accept cookies, you may have to manually input user IDs and passwords to receive certain data.\n\n=====Safeguarding Personally Identifying Information=====\nWe aim to protect the personally identifying information you share with us. OpenROV uses a variety of commercially available security technologies to protect your personally identifying information, including secure servers, firewalls and encryption of some data.\n\nBulletin boards, forums and/or newsgroups are also available to you on OpenROV\'s web sites. Please remember that any information that you provide in these areas becomes public and you should exercise caution in deciding to disclose it.\n\n=====Disclosure to Third Parties=====\nUnder certain circumstances, personally identifying information may be given to OpenROV business partners when we believe your business interests will be served. For instance, if we need to ship products to you, we will share your name and address with a carrier. OpenROV will also release personally identifying information if compelled by law to do so. Otherwise, OpenROV will not provide your personally identifying information to any third party outside the OpenROV team without your consent.\n\n=====Children under the age of 13=====\nThe vast majority of the OpenROV web sites do not target and are not intended for children under the age of 13. OpenROV values the privacy needs of these children and encourages parents to be an active participant in their child\'s online activities and interests. We abide by the Children\'s Online Privacy Protection Act (COPPA) requirements. OpenROV\'s web sites that do not target children will not knowingly collect data from them. If we discover personal data from a child that has been provided through an OpenROV website that is targeted to adults and older children, we will eliminate that data.\n\n=====Contact us=====\n* If you have any questions about our privacy policy, e-mail us at [mailto:Info@OpenROV.com Info@OpenROV.com]\n\nWe reserve the right to change this policy at any time. While we do not intend to make changes to this policy very often, it is always a good idea to double check our most current policy statement when you visit us to be sure that you have read and agree with what information we collect, how we use it and under what circumstances we disclose it.','utf-8'),(87,'Placeholder','utf-8'),(88,'==What is OpenROV?==\n\nOpenROV is a  Do It Yourself telerobotics community centered around underwater exploration and education. We have developed a low-cost telerobotic submarine that can be built with mostly off-the-shelf parts. The goal of OpenROV is to democratize exploration by allowing anyone to explore and study underwater environments. The  [http://openrov.com/forum OpenROV community] is also laying the foundation for globally-connected citizen scientists to share their data and findings.  Questions or suggestions? Feel free to email us at [mailto:Info@OpenROV.com Info@OpenROV.com].','utf-8'),(89,'__NOTITLE__\n==What is OpenROV?==\n\nOpenROV is a  Do It Yourself telerobotics community centered around underwater exploration and education. We have developed a low-cost telerobotic submarine that can be built with mostly off-the-shelf parts. The goal of OpenROV is to democratize exploration by allowing anyone to explore and study underwater environments. The  [http://openrov.com/forum OpenROV community] is also laying the foundation for globally-connected citizen scientists to share their data and findings.  Questions or suggestions? Feel free to email us at [mailto:Info@OpenROV.com Info@OpenROV.com].','utf-8'),(90,'__NOTITLE__\n==What is OpenROV?==\n{| style=\"background-color: #ffffff;\" width=\"95%\"\n|-\n| style=\"width: 50%; background-color: white;\"| OpenROV is a  Do It Yourself telerobotics community centered around underwater exploration and education. We have developed a low-cost telerobotic submarine that can be built with mostly off-the-shelf parts. The goal of OpenROV is to democratize exploration by allowing anyone to explore and study underwater environments. The  [http://openrov.com/forum OpenROV community] is also laying the foundation for globally-connected citizen scientists to share their data and findings.  Questions or suggestions? Feel free to email us at [mailto:Info@OpenROV.com Info@OpenROV.com].\n| style=\"width: 50%;\"|<html>\n<!-- This version of the embed code is no longer supported. Learn more: https://vimeo.com/help/faq/embedding --> <object width=\"500\" height=\"281\"><param name=\"allowfullscreen\" value=\"true\" /><param name=\"allowscriptaccess\" value=\"always\" /><param name=\"movie\" value=\"http://vimeo.com/moogaloop.swf?clip_id=44088059&amp;force_embed=1&amp;server=vimeo.com&amp;show_title=1&amp;show_byline=0&amp;show_portrait=0&amp;color=ff9933&amp;fullscreen=1&amp;autoplay=0&amp;loop=0\" /><embed src=\"http://vimeo.com/moogaloop.swf?clip_id=44088059&amp;force_embed=1&amp;server=vimeo.com&amp;show_title=1&amp;show_byline=0&amp;show_portrait=0&amp;color=ff9933&amp;fullscreen=1&amp;autoplay=0&amp;loop=0\" type=\"application/x-shockwave-flash\" allowfullscreen=\"true\" allowscriptaccess=\"always\" width=\"500\" height=\"281\"></embed></object> <p><a href=\"http://vimeo.com/44088059\">OpenROV Meets the OpenWATER</a> from <a href=\"http://vimeo.com/user889513\">Gerty</a> on <a href=\"http://vimeo.com\">Vimeo</a>.</p>\n</html> \n|}\n\n==Where can I get help?==\nIf you need help following instructions or if you\'re stuck at some step and something has gone wrong there are several ways to get help from the OpenROV users and developer community.\n\nFirst, carefully re-read and review all applicable instructions and make sure you didn\'t do something wrong or out of sequence. Many of these instructions involve long commands, and just one wrong character will mess the whole thing up. Additionally, You can also check the Troubleshooting page for additional information.\n\nIf you continue to have issues, ask the community for help. Your resources for help include:\n\n* [http://wiki.openrov.com OpenROV Wiki] — for searching & contributing documentation; registration is required to contribute.\n* [http://webchat.freenode.net/?channels=openrov OpenROV IRC channel] on [http://freenode.net/ Freenode] — for immediate chat, one-on-one assistance; registration is required (see Nick Setup or you will not be able to enter).\n* [http://openrov.com/forum OpenROV Forum] — a forum dedicated to OpenROV and other related stuff; registration is required to post.\n\nAlthough most community members are happy to provide advice and help, please remember most people volunteer their personal time and effort in doing so. Observing patience and courtesy goes a long way.\n\n==Documentation Guides==\n{| \n| [[File:Gauge.png]] || [[Getting Started]]\n|-\n| [[File:Crate.png]] || [[Downloads]]\n|-\n| [[File:Book.png]] || [[Assembly]]\n|-\n| [[File:Videos.jpeg]] || [[Deployment]]\n|-\n| [[File:Question.png]] || [[Troubleshooting]]\n|}','utf-8'),(91,'====Eric Stackpole====\n\n====David Lang====\n\n====Bran Sorem====','utf-8'),(92,'====Eric Stackpole====\n* Github: [https://github.com/estackpole estackpole]\n* Twitter: [https://twitter.com/#!/eerrp @Eerrp]\n* Personal website: http://ericstackpole.com/\n====David Lang====\n* Github: [https://github.com/davidtlang davidtlang]\n* Twitter: [https://twitter.com/#!/davidtlang @davidtlang]\n* Personal website: http://davidtlang.com/\n====Bran Sorem====\n* Github: [https://github.com/bransorem bransorem]\n* Twitter: [https://twitter.com/#!/bransorem @bransorem]\n* Personal website: http://bransorem.com','utf-8'),(93,'====Eric Stackpole====\nFounder and main developer for the OpenROV project\n* Github: [https://github.com/estackpole estackpole]\n* Twitter: [https://twitter.com/#!/eerrp @Eerrp]\n* Personal website: http://ericstackpole.com/\n\n====David Lang====\n* Github: [https://github.com/davidtlang davidtlang]\n* Twitter: [https://twitter.com/#!/davidtlang @davidtlang]\n* Personal website: http://davidtlang.com/\n====Bran Sorem====\n* Github: [https://github.com/bransorem bransorem]\n* Twitter: [https://twitter.com/#!/bransorem @bransorem]\n* Personal website: http://bransorem.com','utf-8'),(94,'\n* navigation\n** mainpage|mainpage-description\n** portal-url|portal\n** currentevents-url|currentevents\n** recentchanges-url|recentchanges\n** randompage-url|randompage\n* foo','utf-8'),(95,'\n* navigation\n** mainpage|mainpage-description\n** portal-url|portal\n** currentevents-url|currentevents\n** recentchanges-url|recentchanges\n** randompage-url|randompage\n* foo\n** mainpage|mainpage-description','utf-8'),(96,'We are moving our code to Github at: https://github.com/OpenROV\n\nHere is the software used to operate ROV-1\n \n[https://github.com/Avistar/c3-ios-rp/zipball/0.3.6 Download Latest Software]\n\nThere are two separate programs: OBCROV-1 (On Board Controller for ROV-1) which runs on the [http://www.arduino.cc/ Arduino] on board the ROV, and TSCROV-1 (Top Side Controller for ROV-1) which runs through [http://processing.org/ Processing] on a computer used to control the ROV.\n \nYou can find the source code for both programs here  (you can copy/past the entire content of each page into the appropriate compiler (Arduino for OBCROV-1 and Processing for TSCROV-1):\n\n[[OBCROV-1]]\n\n[[TSCROV-1]]','utf-8'),(97,'We have moved all of our software development and files over to [http://github.com/OpenROV GitHub].\n\nHere is the software used to operate ROV-1\n\nThere are two separate programs: OBCROV-1 (On Board Controller for ROV-1) which runs on the [http://www.arduino.cc/ Arduino] on board the ROV, and TSCROV-1 (Top Side Controller for ROV-1) which runs through [http://processing.org/ Processing] on a computer used to control the ROV.\n \nYou can find the source code for both programs here  (you can copy/past the entire content of each page into the appropriate compiler (Arduino for OBCROV-1 and Processing for TSCROV-1):\n\n[[OBCROV-1]]\n\n[[TSCROV-1]]','utf-8'),(98,'\n* navigation\n** mainpage|mainpage-description\n** portal-url|portal\n** currentevents-url|currentevents\n** recentchanges-url|recentchanges\n** randompage-url|randompage\n* Contributing\n** mainpage|mainpage-description','utf-8'),(99,'\n* navigation\n** mainpage|mainpage-description\n** portal-url|portal\n** currentevents-url|currentevents\n** recentchanges-url|recentchanges\n** randompage-url|randompage\n* Contributing\n** Community_Members|Community_Members','utf-8'),(100,'\n* navigation\n** mainpage|mainpage-description\n** portal-url|portal\n** currentevents-url|currentevents\n** recentchanges-url|recentchanges\n** randompage-url|randompage\n* Contributing\n** Community_Members|The Team','utf-8'),(101,'\n* navigation\n** mainpage|mainpage-description\n** portal-url|portal\n** currentevents-url|currentevents\n** recentchanges-url|recentchanges\n** randompage-url|randompage\n* Contributing\n** Community_Members|The Team\n* Documentation\n** Getting_Started|Getting Started\n** Downloads|Downloads\n** Assembly|Assembly\n** Deployment|Deployment\n** Troubleshooting|Troubleshooting','utf-8'),(102,'\n* navigation\n** mainpage|mainpage-description\n** Community_Members|The Team\n** portal-url|portal\n** currentevents-url|currentevents\n** recentchanges-url|recentchanges\n** randompage-url|randompage\n* Documentation\n** Getting_Started|Getting Started\n** Downloads|Downloads\n** Assembly|Assembly\n** Deployment|Deployment\n** Troubleshooting|Troubleshooting','utf-8'),(103,'\n* navigation\n** mainpage|mainpage-description\n** Community_Members|The Team\n** currentevents-url|currentevents\n** recentchanges-url|recentchanges\n* Documentation\n** Getting_Started|Getting Started\n** Downloads|Downloads\n** Assembly|Assembly\n** Deployment|Deployment\n** Troubleshooting|Troubleshooting','utf-8'),(104,'\n* navigation\n** mainpage|mainpage-description\n** Community_Members|The Team\n** currentevents-url|currentevents\n** recentchanges-url|recentchanges\n* Documentation\n** Getting_Started|Getting Started\n** Downloads|Downloads\n** Assembly|Assembly\n** Deployment|Deployment\n** Troubleshooting|Troubleshooting\n** Contributing|Contributing','utf-8'),(105,'This is a series of guides on how to successfully contribute to the development of OpenROV','utf-8'),(106,'===== Overview =====\nAt OpenROV we use Git as our version control system. In addition, all of our open source projects, are hosted on Github. For this reason, if you plan on contributing to OpenROV, it\'s critical that you understand at least the basics of how Git and Github work.\n\nThe following sections give some references and tips for getting started with Git & Github. With this knowledge you\'ll better understand how OpenROV manages our open source projects. Also, you\'ll have the opportunity to start integrating this powerful version control system into your own workflow.\n\n===== Learning Git and Github =====','utf-8'),(107,'At OpenROV we use Git as our version control system. In addition, all of our open source projects, are hosted on Github. For this reason, if you plan on contributing to OpenROV, it\'s critical that you understand at least the basics of how Git and Github work.\n\nThe following sections give some references and tips for getting started with Git & Github. With this knowledge you\'ll better understand how OpenROV manages our open source projects. Also, you\'ll have the opportunity to start integrating this powerful version control system into your own workflow.\n\n=====Learning Git and Github=====\nGit can be a little daunting if you\'ve never used it before, but most people soon learn to love it. The following resources will help you to get started:\n\n=====Git Prerequisites=====\n\n=====Some Quick Git Tips=====','utf-8'),(108,'At OpenROV we use Git as our version control system. In addition, all of our open source projects, are hosted on Github. For this reason, if you plan on contributing to OpenROV, it\'s critical that you understand at least the basics of how Git and Github work.\n\nThe following sections give some references and tips for getting started with Git & Github. With this knowledge you\'ll better understand how OpenROV manages our open source projects. Also, you\'ll have the opportunity to start integrating this powerful version control system into your own workflow.\n\n=====Learning Git and Github=====\n\nGit can be a little daunting if you\'ve never used it before, but most people soon learn to love it. The following resources will help you to get started:\n\n=====Git Prerequisites=====\n\n=====Some Quick Git Tips=====','utf-8'),(109,'At OpenROV we use Git as our version control system. In addition, all of our open source projects, are hosted on Github. For this reason, if you plan on contributing to OpenROV, it\'s critical that you understand at least the basics of how Git and Github work.\n\nThe following sections give some references and tips for getting started with Git & Github. With this knowledge you\'ll better understand how OpenROV manages our open source projects. Also, you\'ll have the opportunity to start integrating this powerful version control system into your own workflow.\n\n==== Learning Git and Github ====\n \nGit can be a little daunting if you\'ve never used it before, but most people soon learn to love it. The following resources will help you to get started:\n\n==== Git Prerequisites ====\n\n==== Some Quick Git Tips ====','utf-8'),(110,'==== Overview ====\nAt OpenROV we use Git as our version control system. In addition, all of our open source projects, are hosted on Github. For this reason, if you plan on contributing to OpenROV, it\'s critical that you understand at least the basics of how Git and Github work.\n\nThe following sections give some references and tips for getting started with Git & Github. With this knowledge you\'ll better understand how OpenROV manages our open source projects. Also, you\'ll have the opportunity to start integrating this powerful version control system into your own workflow.\n\n==== Learning Git and Github ====\n \nGit can be a little daunting if you\'ve never used it before, but most people soon learn to love it. The following resources will help you to get started:\n\n* [http://git-scm.com/ Git Official Website]\n* Michael Marner\'s [http://www.youtube.com/user/MichaelMarner#p/u/9/HaSDIdNkCDQ Git Tutorial] (video)\n* Github [http://learn.github.com/p/intro.html Introduction to Git] (video)\n* Linus Torvalds\' [http://www.youtube.com/watch?v=4XpnKHJAok8 Git Tech Talk] (video)\n* The [http://progit.org/book/ Pro Git Book]\n* the git help command and the [http://www.kernel.org/pub/software/scm/git/docs/ Git online manual]\n* [http://gitref.org/ Github Git Reference] (manual)\n* the Freenode IRC server\'s #git channel\n* and [http://www.google.com/search?hl=en&q=git+version+control many others]\n\n==== Git Prerequisites ====\n\nBefore you start, you will need to work through these points:\n\n* configure SSH, required for pushing branches to Github. See \"Generating SSH Keys\" for [http://help.github.com/linux-key-setup/ Linux], [http://help.github.com/mac-key-setup/ Mac OSX] and [http://help.github.com/msysgit-key-setup/ Windows].\n\n==== Some Quick Git Tips ====\n\n==== Committing Code with Git in 7 Easy Stages ====','utf-8'),(111,'==== Overview ====\nAt OpenROV we use Git as our version control system. In addition, all of our open source projects, are hosted on Github. For this reason, if you plan on contributing to OpenROV, it\'s critical that you understand at least the basics of how Git and Github work.\n\nThe following sections give some references and tips for getting started with Git & Github. With this knowledge you\'ll better understand how OpenROV manages our open source projects. Also, you\'ll have the opportunity to start integrating this powerful version control system into your own workflow.\n\n==== Learning Git and Github ====\n \nGit can be a little daunting if you\'ve never used it before, but most people soon learn to love it. The following resources will help you to get started:\n\n* [http://git-scm.com/ Git Official Website]\n* Michael Marner\'s [http://www.youtube.com/user/MichaelMarner#p/u/9/HaSDIdNkCDQ Git Tutorial] (video)\n* Github [http://learn.github.com/p/intro.html Introduction to Git] (video)\n* Linus Torvalds\' [http://www.youtube.com/watch?v=4XpnKHJAok8 Git Tech Talk] (video)\n* The [http://progit.org/book/ Pro Git Book]\n* the git help command and the [http://www.kernel.org/pub/software/scm/git/docs/ Git online manual]\n* [http://gitref.org/ Github Git Reference] (manual)\n* the Freenode IRC server\'s #git channel\n* and [http://www.google.com/search?hl=en&q=git+version+control many others]\n\n==== Git Prerequisites ====\n\nBefore you start, you will need to work through these points:\n\n* configure SSH, required for pushing branches to Github. See \"Generating SSH Keys\" for [http://help.github.com/linux-key-setup/ Linux], [http://help.github.com/mac-key-setup/ Mac OSX] and [http://help.github.com/msysgit-key-setup/ Windows].\n\n==== Some Quick Git Tips ====\n* use [http://gitk.sourceforge.net/development.html gitk] to give a visual representation of your repository\n* by default, if a file\'s permissions change, Git will perceive it just the same as if its contents were changed, Thus, to ignore permissions changes, run:\n\n<code>git config core.filemode false</code>\n\n==== Committing Code with Git in 7 Easy Stages ====','utf-8'),(112,'This is a series of guides on how to successfully contribute to the development of OpenROV\n\n* [[Git and Github|Git & Github]]\n* How to Contribute Code','utf-8'),(113,'CLA | fusion94@gmail.com | (from contact form)','utf-8'),(114,'\n<emailform>\n {| \n | Name: || <emailform name=40 /> || (optional)\n |-\n | Email: || <emailform from=40 /> || (optional, unless you\'d like a reply)\n |-\n | Comments:\n | colspan=\"2\" | <emailform comments=80x8 />\n |-\n | colspan=\"3\" align=\"center\" | <email