 a Homebrewer. Fan of Open Source, Linux, OSX and Mobile.\n\nOne of the Co-Founders of SourceForge.net. Purveyor of Beer and Single Malt Scotches. Avid Motorcyclist and Porsche 911 Owner.\n\nSpent 8 years of my life jumping out of airplanes for the US Army doing high speed/low drag shit. Combat Veteran. \n\n* https://github.com/fusion94\n* https://github.com/DamageStudios\n* https://github.com/3D-Bots','utf-8'),(129,'{| class=\"wikitable sortable\"\n|-\n! Serial Number !! Owner !! Type !! City !! State !! Country !! Date Built\n|-\n| 001 || Eric Stackpole || || Cupertino || CA || USA ||\n|-\n| 002 || Eric Stackpole || || Cupertino || CA || USA ||\n|-\n| 003 || Eric Stackpole || || Cupertino || CA || USA ||\n|-\n| 004 || Eric Stackpole || || Cupertino || CA || USA ||\n|-\n| 005 || Eric Stackpole || || Cupertino || CA || USA ||\n|-\n| 006 || Eric Stackpole || || Cupertino || CA || USA ||\n|-\n| 007 || Eric Stackpole || || Cupertino || CA || USA ||\n|-\n| 008 || Eric Stackpole || || Cupertino || CA || USA ||\n|-\n| 009 || Eric Stackpole || || Cupertino || CA || USA ||\n|-\n| 010 || Eric Stackpole || || Cupertino || CA || USA ||\n|-\n| 011 || Eric Stackpole || || Cupertino || CA || USA ||\n|-\n| 012 || Eric Stackpole || || Cupertino || CA || USA ||\n|-\n| 013 ||  || || || || ||\n|-\n| 014 ||  || || || || ||\n|-\n| 015 ||  || || || || ||\n|-\n| 016 ||  || || || || ||\n|-\n| 017 ||  || || || || ||\n|-\n| 018 ||  || || || || ||\n|-\n| 019 ||  || || || || ||\n|-\n| 020 ||  || || || || ||\n|-\n| 021 ||  || || || || ||\n|-\n| 022 ||  || || || || ||\n|-\n| 023 ||  || || || || ||\n|-\n| 024 ||  || || || || ||\n|-\n| 025 ||  || || || || ||\n|-\n| 026 ||  || || || || ||\n|-\n| 027 ||  || || || || ||\n|-\n| 028 || Bill Mar || OpenROV 2.3 || Scottsdale || AZ || USA ||\n|-\n| 029 || Bill Mar || OpenROV 2.3 Mod || Scottsdale || AZ || USA ||\n|-\n| 030 || Bill Mar || OpenROV 2.3 Mod || Scottsdale || AZ || USA ||\n|-\n| 031 || Bill Mar || || Scottsdale || AZ || USA ||\n|-\n| 032 || Bill Mar || || Scottsdale || AZ || USA ||\n|-\n| 033 || || || || || ||\n|-\n| 034 || [[User:Fusion94|Tony Guntharp]] || || Half Moon Bay || CA || USA ||\n|-\n| 035 ||  || || || || ||\n|-\n| 036 || Jacob Guldberg || OpenROV 2.2 || || || ||\n|-\n| 037 || Alessandro Fabbris || OpenROV 2.2 || || || ||\n|-\n| 038 || Brad Collette || OpenROV 2.2 || || || ||\n|-\n| 039 || Stephen Olsen || OpenROV 2.3.2 || Fremont || CA || USA ||\n|-\n| 040 || Stephen Olsen || OpenROV 2.3.2 || Fremont || CA || USA ||\n|-\n| 041 || Stephen Olsen || OpenROV 2.3.2|| Fremont || CA || USA ||\n|-\n|}','utf-8'),(130,'\nTwitter\n\nFacebook','utf-8'),(131,'\n==== Twitter ====\n\n{| class=\"wikitable\"\n|-\n! Date !! Number of Followers !! +/-\n|-\n| July 1st, 2012 || 408 || -\n|-\n| July 8th, 2012 || ||\n|-\n| July 15th, 2012 || ||\n|-\n| July 22nd, 2012 || ||\n|-\n| July 29th, 2012 || ||\n|}\n\n==== Facebook ====\n\n{| class=\"wikitable\"\n|-\n! Date !! Number of Likes !! +/-\n|-\n| July 1st, 2012 || 244 || -\n|-\n| July 8th, 2012 || ||\n|-\n| July 15th, 2012 || ||\n|-\n| July 22nd, 2012 || ||\n|-\n| July 29th, 2012 || ||\n|}','utf-8'),(132,'We use Github to host our code.  Please visit the Github profile at: [http://github.com/OpenROV http://github.com/OpenROV]\n\nWe separate the assets into 3 categories:\n\n* [http://github.com/OpenROV/openrov-hardware Hardware]\n* [http://github.com/OpenROV/openrov-software Software]\n* [http://github.com/OpenROV/openrov-electronics Electronics]\n\nThe hardware section contains the CAD files for cutting the ROV.  The software section contains the software for running the ROV (the software that runs on the on-board computer and Arduino).  The electronics section contains the schematic files for the BeagleBone cape.  Each section will probably be expanded, but we may combine some parts if it makes sense.','utf-8'),(133,'==== Overview ====\nWe use Git as our version control system and Github as our central repository.  For this reason, if you plan on contributing to OpenROV it\'s critical that you understand at least the basics of how Git and Github work.\n\nThe following sections give some references and tips for getting started with Git and Github.  With this knowledge, you\'ll better understand how we manage our open-source projects.  Also, you\'ll have the opportunity to start integrating this powerful version control system into your own workflow.\n\n==== Learning Git and Github ====\n \nGit can be a little daunting if you\'ve never used it before, but most people soon learn to love it. The following resources will help you to get started:\n\n* [http://git-scm.com/ Git Official Website]\n* Michael Marner\'s [http://www.youtube.com/user/MichaelMarner#p/u/9/HaSDIdNkCDQ Git Tutorial] (video)\n* Github [http://learn.github.com/p/intro.html Introduction to Git] (video)\n* Linus Torvalds\' [http://www.youtube.com/watch?v=4XpnKHJAok8 Git Tech Talk] (video)\n* The [http://progit.org/book/ Pro Git Book]\n* the git help command and the [http://www.kernel.org/pub/software/scm/git/docs/ Git online manual]\n* [http://gitref.org/ Github Git Reference] (manual)\n* the Freenode IRC server\'s #git channel\n* and [http://www.google.com/search?hl=en&q=git+version+control many others]\n\n==== Git Prerequisites ====\n\nBefore you start, you will need to work through these points:\n\n* configure SSH, required for pushing branches to Github. See \"Generating SSH Keys\" for [http://help.github.com/linux-key-setup/ Linux], [http://help.github.com/mac-key-setup/ Mac OSX] and [http://help.github.com/msysgit-key-setup/ Windows].\n\n==== Some Quick Git Tips ====\n* use [http://gitk.sourceforge.net/development.html gitk] to give a visual representation of your repository\n* by default, if a file\'s permissions change, Git will perceive it just the same as if its contents were changed, Thus, to ignore permissions changes, run:\n\n<code>git config core.filemode false</code>\n\n==== Committing Code with Git in 7 Easy Stages ====','utf-8'),(134,'==== Overview ====\nWe use Git as our version control system and Github as our central repository.  For this reason, if you plan on contributing to OpenROV it\'s critical that you understand at least the basics of how Git and Github work.\n\nThe following sections give some references and tips for getting started with Git and Github.  With this knowledge, you\'ll better understand how we manage our open-source projects.  Also, you\'ll have the opportunity to start integrating this powerful version control system into your own workflow.\n\n==== Learning Git and Github ====\n \nGit can be a little daunting if you\'ve never used it before, but most people soon learn to love it. The following resources will help you to get started:\n\n* [http://git-scm.com/ Git Official Website]\n* [http://try.github.com/ Try Git]\n* Michael Marner\'s [http://www.youtube.com/user/MichaelMarner#p/u/9/HaSDIdNkCDQ Git Tutorial] (video)\n* Github [http://learn.github.com/p/intro.html Introduction to Git] (video)\n* Linus Torvalds\' [http://www.youtube.com/watch?v=4XpnKHJAok8 Git Tech Talk] (video)\n* The [http://progit.org/book/ Pro Git Book]\n* the git help command and the [http://www.kernel.org/pub/software/scm/git/docs/ Git online manual]\n* [http://gitref.org/ Github Git Reference] (manual)\n* the Freenode IRC server\'s #git channel\n* and [http://www.google.com/search?hl=en&q=git+version+control many others]\n\n==== Git Prerequisites ====\n\nBefore you start, you will need to work through these points:\n\n* configure SSH, required for pushing branches to Github. See \"Generating SSH Keys\" for [http://help.github.com/linux-key-setup/ Linux], [http://help.github.com/mac-key-setup/ Mac OSX] and [http://help.github.com/msysgit-key-setup/ Windows].\n\n==== Some Quick Git Tips ====\n* use [http://gitk.sourceforge.net/development.html gitk] to give a visual representation of your repository\n* by default, if a file\'s permissions change, Git will perceive it just the same as if its contents were changed, Thus, to ignore permissions changes, run:\n\n<code>git config core.filemode false</code>\n\n==== Committing Code with Git in 7 Easy Stages ====','utf-8'),(135,'==== Overview ====\nWe use Git as our version control system and Github as our central repository.  For this reason, if you plan on contributing to OpenROV it\'s critical that you understand at least the basics of how Git and Github work.\n\nThe following sections give some references and tips for getting started with Git and Github.  With this knowledge, you\'ll better understand how we manage our open-source projects.  Also, you\'ll have the opportunity to start integrating this powerful version control system into your own workflow.\n\n==== Learning Git and Github ====\n \nGit can be a little daunting if you\'ve never used it before, but most people soon learn to love it. The following resources will help you to get started:\n\n* [http://git-scm.com/ Git Official Website]\n* [http://try.github.com/ Try Git] (interactive tutorial)\n* Michael Marner\'s [http://www.youtube.com/user/MichaelMarner#p/u/9/HaSDIdNkCDQ Git Tutorial] (video)\n* Github [http://learn.github.com/p/intro.html Introduction to Git] (video)\n* Linus Torvalds\' [http://www.youtube.com/watch?v=4XpnKHJAok8 Git Tech Talk] (video)\n* The [http://progit.org/book/ Pro Git Book]\n* the git help command and the [http://www.kernel.org/pub/software/scm/git/docs/ Git online manual]\n* [http://gitref.org/ Github Git Reference] (manual)\n* the Freenode IRC server\'s #git channel\n* and [http://www.google.com/search?hl=en&q=git+version+control many others]\n\n==== Git Prerequisites ====\n\nBefore you start, you will need to work through these points:\n\n* configure SSH, required for pushing branches to Github. See \"Generating SSH Keys\" for [http://help.github.com/linux-key-setup/ Linux], [http://help.github.com/mac-key-setup/ Mac OSX] and [http://help.github.com/msysgit-key-setup/ Windows].\n\n==== Some Quick Git Tips ====\n* use [http://gitk.sourceforge.net/development.html gitk] to give a visual representation of your repository\n* by default, if a file\'s permissions change, Git will perceive it just the same as if its contents were changed, Thus, to ignore permissions changes, run:\n\n<code>git config core.filemode false</code>\n\n==== Committing Code with Git in 7 Easy Stages ====','utf-8'),(136,'\n==== Twitter ====\n\n{| class=\"wikitable\"\n|-\n! Date !! Number of Followers !! +/-\n|-\n| July 1st, 2012 || 408 || -\n|-\n| July 8th, 2012 || 462 || +54\n|-\n| July 15th, 2012 || ||\n|-\n| July 22nd, 2012 || ||\n|-\n| July 29th, 2012 || ||\n|}\n\n==== Facebook ====\n\n{| class=\"wikitable\"\n|-\n! Date !! Number of Likes !! +/-\n|-\n| July 1st, 2012 || 244 || -\n|-\n| July 8th, 2012 || ||\n|-\n| July 15th, 2012 || ||\n|-\n| July 22nd, 2012 || ||\n|-\n| July 29th, 2012 || ||\n|}','utf-8'),(137,'\n==== Twitter ====\n\n{| class=\"wikitable\"\n|-\n! Date !! Number of Followers !! +/-\n|-\n| July 1st, 2012 || 408 || -\n|-\n| July 8th, 2012 || 462 || +54\n|-\n| July 15th, 2012 || ||\n|-\n| July 22nd, 2012 || ||\n|-\n| July 29th, 2012 || ||\n|}\n\n==== Facebook ====\n\n{| class=\"wikitable\"\n|-\n! Date !! Number of Likes !! +/-\n|-\n| July 1st, 2012 || 244 || -\n|-\n| July 8th, 2012 || 306 || +62\n|-\n| July 15th, 2012 || ||\n|-\n| July 22nd, 2012 || ||\n|-\n| July 29th, 2012 || ||\n|}','utf-8'),(138,'\n==== Twitter ====\n\n{| class=\"wikitable\"\n|-\n! Date !! Number of Followers !! +/-\n|-\n| July 1st, 2012 || 408 || -\n|-\n| July 8th, 2012 || 466 || +58\n|-\n| July 15th, 2012 || ||\n|-\n| July 22nd, 2012 || ||\n|-\n| July 29th, 2012 || ||\n|}\n\n==== Facebook ====\n\n{| class=\"wikitable\"\n|-\n! Date !! Number of Likes !! +/-\n|-\n| July 1st, 2012 || 244 || -\n|-\n| July 8th, 2012 || 306 || +62\n|-\n| July 15th, 2012 || ||\n|-\n| July 22nd, 2012 || ||\n|-\n| July 29th, 2012 || ||\n|}','utf-8'),(139,'\n==== Twitter ====\n\n{| class=\"wikitable\"\n|-\n! Date !! Number of Followers !! +/-\n|-\n| July 1st, 2012 || 408 || -\n|-\n| July 8th, 2012 || 466 || +58\n|-\n| July 15th, 2012 || ||\n|-\n| July 22nd, 2012 || ||\n|-\n| July 29th, 2012 || ||\n|}\n\n==== Facebook ====\n\n{| class=\"wikitable\"\n|-\n! Date !! Number of Likes !! +/-\n|-\n| July 1st, 2012 || 244 || -\n|-\n| July 8th, 2012 || 309 || +65\n|-\n| July 15th, 2012 || ||\n|-\n| July 22nd, 2012 || ||\n|-\n| July 29th, 2012 || ||\n|}','utf-8'),(140,'We use Github to host our code.  Please visit the Github profile at: [http://github.com/OpenROV http://github.com/OpenROV]\n\nWe\'ve broken it up into 3 categories:\n\n* [http://github.com/OpenROV/openrov-hardware Hardware]\n* [http://github.com/OpenROV/openrov-software Software]\n* [http://github.com/OpenROV/openrov-electronics Electronics]\n\nThe hardware section contains the CAD files for cutting the ROV.  The software section contains the software for running the ROV (the software that runs on the on-board computer and Arduino).  The electronics section contains the schematic files for the BeagleBone cape.  Each section will probably be expanded, but we may combine some parts if it makes sense.','utf-8'),(141,'==== Overview ====\nWe use Git as our version control system and Github as our central repository.  For this reason, if you plan on contributing to OpenROV, it\'s critical that you understand at least the basics of how Git and Github work.\n\nThe following sections give some references and tips for getting started with Git and Github.  With this knowledge, not only will you better understand how we manage our open-source projects, but you\'ll also have the opportunity to start integrating this powerful version control system into your own workflow.\n\n==== Learning Git and Github ====\n \nGit can be a little daunting if you\'ve never used it before, but most people soon learn to love it. The following resources will help you to get started:\n\n* [http://git-scm.com/ Git Official Website]\n* [http://try.github.com/ Try Git] (interactive tutorial)\n* Michael Marner\'s [http://www.youtube.com/user/MichaelMarner#p/u/9/HaSDIdNkCDQ Git Tutorial] (video)\n* Github [http://learn.github.com/p/intro.html Introduction to Git] (video)\n* Linus Torvalds\' [http://www.youtube.com/watch?v=4XpnKHJAok8 Git Tech Talk] (video)\n* The [http://progit.org/book/ Pro Git Book]\n* the git help command and the [http://www.kernel.org/pub/software/scm/git/docs/ Git online manual]\n* [http://gitref.org/ Github Git Reference] (manual)\n* the Freenode IRC server\'s #git channel\n* and [http://www.google.com/search?hl=en&q=git+version+control many others]\n\n==== Git Prerequisites ====\n\nBefore you start, you will need to work through these points:\n\n* configure SSH, required for pushing branches to Github. See \"Generating SSH Keys\" for [http://help.github.com/linux-key-setup/ Linux], [http://help.github.com/mac-key-setup/ Mac OSX] and [http://help.github.com/msysgit-key-setup/ Windows].\n\n==== Some Quick Git Tips ====\n* use [http://gitk.sourceforge.net/development.html gitk] to give a visual representation of your repository\n* by default, if a file\'s permissions change, Git will perceive it just the same as if its contents were changed, Thus, to ignore permissions changes, run:\n\n<code>git config core.filemode false</code>\n\n==== Committing Code with Git in 7 Easy Stages ====','utf-8'),(142,'Learn about the software architecture.','utf-8'),(143,'= Architectural Overview =\n\nThe main architecture for ROVision is that of the [http://en.wikipedia.org/wiki/Client_server client-server model], where the ROV hosts the server and your computer is the client. The connection to the client is managed through WebSockets using [http://socket.io/ Socket.io].\n\nThe two main technologies we’re using for ROVision are [http://nodejs.org/ Node.js] and [http://opencv.willowgarage.com/ OpenCV]. Node.js is sort of like the “brains” of the ROV - it bridges the connection between the ROV and the user.\n\nIt can also be separated into two other sections: visual input and control input. The visual input is the images from the on-board webcam and the control input comes from the user (i.e. keyboard or gamepad control). When the user connects to the Node server, it spawns a child process - the camera capture process.\n\nThe capture process is where one can leverage the power of OpenCV to utilize amazing computer vision algorithms. This process constantly waits for output from the Node server in the form of timestamp-format strings over standard input (STDIN).\n\nEssentially, the Node process says “take a photo” (say, 30 times per second) to the capture process, which then captures and saves the photo to shared memory, after which it writes the timestamp-format string through standard out (STDOUT) to the Node server - as a sort of “here you go” response. The Node server then opens the file of the name it receives (timestamp-format string) and reads it as a base64-encoded string. Then, the Node server sends that string to the client.\n\nThe client receives the base64-encoded string through javascript which then updates the source attribute of the IMG tag to that string. The user sees a new image.\n\nSince Socket.io is a two-way communication layer, the user can send control commands to the ROV anytime. The user does so by interacting with the keyboard or gamepad, which sends string-formatted commands using javascript to the ROV. The Node server on the ROV then intercepts the move command which it then forwards to the on-board Arduino to actuate the motors.','utf-8'),(144,'If you want to learn about the software, please visit the [[SoftwareArchitecture|software architecture]] page.','utf-8'),(145,'\n* navigation\n** mainpage|mainpage-description\n** Community_Members|The Team\n** currentevents-url|currentevents\n** recentchanges-url|recentchanges\n** Special:Contact|Contact Us\n* Documentation\n** Getting_Started|Getting Started\n** Downloads|Downloads\n** Assembly|Assembly\n** Deployment|Deployment\n** Troubleshooting|Troubleshooting\n** Contributing|Contributing','utf-8'),(146,'<emailform>\n {| \n | Name: || <emailform name=40 /> || (optional)\n |-\n | Email: || <emailform from=40 /> || (optional, unless you\'d like a reply)\n |-\n | Comments:\n | colspan=\"2\" | <emailform comments=80x8 />\n |-\n | colspan=\"3\" align=\"center\" | <emailform submit=\"Send Comments\" />\n |}\n </emailform>\n <emailform result>\n Thanks for your comments!\n {| width=\"300px\"\n | \'\'\'From:\'\'\' <emailform name /> <emailform from/><br />\n \'\'\'Comments:\'\'\' <emailform comments />\n |}\n </emailform>','utf-8'),(147,'Form| fusion94@gmail.com | (from contact form)','utf-8'),(148,'CLA','utf-8'),(149,'CLA2','utf-8'),(150,'=== Contributor License Agreement (\"Agreement\") ===\n\nThank you for your interest in the OpenROV open source project being administered by the OpenROV team. The form of license below is a document that clarifies the terms under which You, the person listed below, may contribute software, bug fixes, configuration changes, documentation, or any other materials that you send to us related to the Project (each a \"Contribution\") to the project. We appreciate your participation in our project, and your help in improving the project, so we want you to understand what will be done with the Contributions. This license is for your protection as well as the protection of OpenROV and its licensees; it does not change your rights to use your own Contributions for any other purpose. Please complete the following information about you and the Contributions.','utf-8'),(151,'__NOTITLE__\n=== Contributor License Agreement (\"Agreement\") ===\n\nThank you for your interest in the OpenROV open source project being administered by the OpenROV team. The form of license below is a document that clarifies the terms under which You, the person listed below, may contribute software, bug fixes, configuration changes, documentation, or any other materials that you send to us related to the Project (each a \"Contribution\") to the project. We appreciate your participation in our project, and your help in improving the project, so we want you to understand what will be done with the Contributions. This license is for your protection as well as the protection of OpenROV and its licensees; it does not change your rights to use your own Contributions for any other purpose. Please complete the following information about you and the Contributions.','utf-8'),(152,'__NOTITLE__\n=== Tony Guntharp ===\nI make things. Software and Hardware, doesn\'t matter.\n\nI\'m OCD, a Geek, a Homebrewer. Fan of Open Source, Linux, OSX and Mobile.\n\nOne of the Co-Founders of SourceForge.net. Purveyor of Beer and Single Malt Scotches. Avid Motorcyclist and Porsche 911 Owner.\n\nSpent 8 years of my life jumping out of airplanes for the US Army doing high speed/low drag shit. Combat Veteran. \n\n* https://github.com/fusion94\n* https://github.com/DamageStudios\n* https://github.com/3D-Bots','utf-8'),(153,'My interests in ROV Submarines','utf-8'),(154,'====Eric Stackpole====\nFounder and main developer for the OpenROV project\n* Github: [https://github.com/estackpole estackpole]\n* Twitter: [https://twitter.com/#!/eerrp @Eerrp]\n* Personal website: http://ericstackpole.com/\n====David Lang====\n* Github: [https://github.com/davidtlang davidtlang]\n* Twitter: [https://twitter.com/#!/davidtlang @davidtlang]\n* Personal website: http://davidtlang.com/\n====Bran Sorem====\n* Github: [https://github.com/bransorem bransorem]\n* Twitter: [https://twitter.com/#!/bransorem @bransorem]\n* Personal website: http://bransorem.com\n====Tony Guntharp====\n* Github: [https://github.com/fusion94 fusion94]\n* Twitter: [https://twitter.com/#!/fusion94 @fusion94]\n* Personal website: http://about.me/fusion94','utf-8'),(155,'Special Hardware Event: A Night with OpenROV - http://www.meetup.com/HardwareStartupSF/events/72306272/','utf-8'),(156,'Special Hardware Event: A Night with OpenROV (July 24th, 2012) - http://www.meetup